import React from 'react'
import './register.css'
const Register = () => {

const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    textAlign: 'center',
    color: theme.palette.text.secondary,
    height: 60,
    lineHeight: '60px',
    }));
  return (
    <div className="main-screen-register h-screen w-screen flex flex-row justify-evenly">
        <div className='left-screen-register'>
        </div>
        <div className='right-screen-register'>

        </div>
    </div>
  )
}

export default Register
